import React from 'react';
import { Card, Row, Col, Statistic } from 'antd';
import { ExperimentOutlined, FileTextOutlined, SettingOutlined } from '@ant-design/icons';

const Home: React.FC = () => {
  return (
    <div>
      <h1>参数拟合工具</h1>
      <Row gutter={16}>
        <Col span={8}>
          <Card>
            <Statistic
              title="已训练参数"
              value={0}
              prefix={<ExperimentOutlined />}
            />
          </Card>
        </Col>
        <Col span={8}>
          <Card>
            <Statistic
              title="数据集数量"
              value={0}
              prefix={<FileTextOutlined />}
            />
          </Card>
        </Col>
        <Col span={8}>
          <Card>
            <Statistic
              title="配置项"
              value={0}
              prefix={<SettingOutlined />}
            />
          </Card>
        </Col>
      </Row>
    </div>
  );
};

export default Home;
